@here 

Our open call for Spring/Summer 2023 has officially closed. Thanks to everyone who submitted an application! ★彡

We will be reviewing all submissions and notifying applicants about our decisions in the coming weeks.

@everyone 
I have some bad news: USDC purchases (including conversions from ETH, XTZ) are currently disabled due to the Ethereum Merge. 

Credit card transactions are still available. We'll restore crypto support as soon as our service provider Wyre is back up.

@here We have bad news: our payment processing system that handles transactions from USDC, credit cards, and XTZ, failed during the early minutes of the opening. As a result, the blockchain and our internal database don't align. We have scenarios in which Feral File may report that you own an edition, but the blockchain reports a different owner. We have other scenarios in which payment was received, but you did not receive the edition you paid for. This is frankly a nightmare situation in that we can't replace what you bought if someone else owns it in the blockchain. This is of particular concern for unique edition artworks and IX Shells' What Time Works For You, which is now sold out. I know there are no apologies that can help those affected. Our next steps are to resolve all issues in the next 24 hours. We will make 1) refunds to any collector who will not receive an edition. 2) correct the database to match the blockchain. Again, this may mean that something that shows up in your account right now may go away.

We expect that all new orders will transact without the aforementioned issues.

After this, we will do a post-mortem to better understand what happened so we can improve our systems and process to prevent future occurrences. In the mean time, we understand if you feel the need to vent your frustration at us. You can email me at michael@bitmark.com with more questions.

